import React, {Component} from 'react';
import {Container, Row, Col, Figure} from 'react-bootstrap';
import '././css/Stock.css';


class Stock extends Component {
	test(){
		alert('successful');
	}
	render(){
		return(
			<div className = "background">
				<h className ="title"> United States Stocks </h>

				<Container className = "filter-title">
					<Row>
						<Col> 
							Market 
								<div className = "filter" onClick ={this.test}> United States &#9660; </div>
						</Col>
						<Col> 
							Industry 
							<div className = "filter"> Technology &#9660; </div>
						</Col>
						<Col className ='more-filter'> More Filters </Col>
					</Row>
				</Container>

				<Container>
					<Row>
						<Col xs={6} md={4}>
						<Image src="holder.js/171x180" rounded />
						</Col>
						<Col xs={6} md={4}>
						<Image src="holder.js/171x180" roundedCircle />
						</Col>
						<Col xs={6} md={4}>
						<Image src="holder.js/171x180" thumbnail />
						</Col>
					</Row>
				</Container>



		    </div>
		);
	}
}

export default Stock;
